    false,nt"url": null,nt"notes": "Drinking water supply management area (DWSMA)
    is the Minnesota Department of Health (MDH) approved surface and subsurface area
    surrounding a public water supply well that completely contains the scientifically
    calculated wellhead protection area and is managed by the entity identified in a
    wellhead protection plan. The boundaries of the drinking water supply management
    area are delineated by identifiable physical features, landmarks or political and
    administrative boundaries.",nt"license_title": null,nt"extras": [{ntt"key":
